(()=>{"use strict";let e=!1;setTimeout((()=>{if(e){let e=new Event("windowScroll");window.addEventListener("scroll",(function(t){document.dispatchEvent(e)}))}}),0);const t=document.querySelector(".card__inner"),n=document.querySelector(".card__text"),o=function(e){let t;function n(){t=e.slice()}return n(),function(){let e;return localStorage.getItem("array")&&(t=JSON.parse(localStorage.getItem("array"))),0===t.length&&(n(),localStorage.removeItem("array")),e=t.splice(Math.floor(Math.random()*t.length),1),localStorage.setItem("array",JSON.stringify(t)),e}}(["Твої очі сяють яскравіше, ніж сонце. Я готовий милуватися ними завжди та всюди!","Коли я бачу твою посмішку, то мені здається, що я зараз розтану або полечу на небеса.","Поруч із тобою мені ніколи не буває нудно.","Ти дивуєш мене все більше і більше з кожним днем. Я шалено щасливий проводити з тобою час.","Твоїй фігурі можуть позаздрити навіть супермоделі.","Відразу видно, що ти любиш спорт і ведеш активний спосіб життя. У тебе прекрасне гнучке тіло!","Іноді, коли я милуюся тобою, то забуваю про все на світі. У такі моменти я виглядаю відстороненим, не гнівайся на мене, будь ласка.","Ти – найяскравіший приклад того, що краса – це могутня сила.","Твої очі та посмішка випромінюють тепло, і мені так приємно знаходитися поряд із тобою.","Твоя посмішка може зробити будь-який день кращим. Я постараюся зробити все, щоб ти посміхалася частіше.","Твій стиль в одязі дуже елегантний і продуманий. Ти дійсно вмієш підкреслити свою красу та індивідуальність.","Сьогодні ти особливо чарівна і спокуслива в цій сукні.Твій запах зводить мене з розуму!","Коли я вперше почув твій сміх, то був по-справжньому зачарований. Готовий слухати його вічно","Ти – найважливіша людина в моєму житті.","У тебе є унікальний дар слухати та чути співрозмовника.","Ти є одною з найцікавіших людей в моєму оточенні, з тобою час летить непомітно.","Твоя доброта підкорила моє серце.","Я дивуюся, як ти постійно генеруєш такі оригінальні та захоплюючі ідеї.","Ти талановита в усьому, чим займаєшся.","Твій голос схожий на чарівну мелодію, і мені дуже подобається його слухати.","Ти завжди виходиш на зв'язок тоді, коли я думаю про тебе.","Я вважаю тебе сильною особистістю, яка завжди знайде вихід з будь-якої ситуації. Але я ніколи не залишу тебе наодинці з твоїми проблемами.","Шкода, що ми не познайомилися раніше. Занадто багато часу згаяно!","Я хотів би завжди тримати тебе у своїх обіймах.","Будь-яка дівчина може взяти з тебе приклад.","Ти завжди вмієш заспокоїти та підтримати мене.","Навіть твої капризи викликають у мене розчулення.","Прогулянка з тобою для мене краща, ніж самі захоплюючі пригоди з кимось іншим.","Поруч з тобою я стаю самим собою.","Ти даруєш мені затишок і тепло.","Я кожен день дякую долі за зустріч з тобою.","Ти відмінно мене знаєш і влаштовуєш мені найкращі сюрпризи.","Навіть якщо ми поруч цілу добу – мені цього мало.","Іноді мені здається, що ти читаєш мої думки та краще за всіх розумієш мої почуття.","Для мене радість – просто бути з тобою.","Ти неймовірно цікава співрозмовниця.","Завжди залишайся собою, адже ти дивовижна дівчина. Ти не боїшся діяти.","Чесність і відкритість – одні з кращих якостей в тобі.","Ти дуже кумедна і дотепна.","Твій магнетизм зачаровує.","Я тобою повністю підкорений.","З перших хвилин знайомства ти зачарувала мене собою.","У тобі прекрасне абсолютно все.","Ти надихаєш мене ставати кращим.","Спасибі за те, що ти є в моєму житті.","У тебе музикальний слух.","Поруч з тобою я відчуваю себе героєм.","Я не можу описати словами, яка ти важлива для мене.","Ти – моє натхнення.","Ми з тобою – споріднені душі.","Твоя думка для мене на першому місці.","Ти чарівна у своїх примхах.","Ти – мій найкращий друг.","Я вважаю, що таких, як ти, більше немає і ніколи не буде.","Ти завжди підіймаєш мені настрій.","Думки про тебе допомагають мені впоратися з будь-якими проблемами.","Твоя інтуїція схожа на магію.","Ми розуміємо один одного з пів слова.","Завдяки тобі я знайшов впевненість у своїх силах.","У тебе талант виступати на публіці.","У тебе є все необхідне, щоб домогтися успіху.","Ти схожа на принцесу з казки.","Твоє самовдосконалення заслуговує на повагу.","Ти зможеш все, якщо повіриш у себе.","Ціную твою індивідуальність.","Ти вмієш визнавати свою неправоту.","У тебе незгасний інтерес до світу.","Ти допомагаєш мені в усіх моїх починаннях","Мені подобається твоя любов до читання.","Ти приголомшливо готуєш. Я навіть боюся набрати вагу від твоїх чудових страв.","Хочу поїхати з тобою на край світу.","Твоя краса зводить мене з розуму.","У тебе незвичайний колір очей, що зачаровує мене.","Твоє волосся, як шовк.","Ти виглядаєш, як янгол.","Ти досконала в моїх очах.","Твоїй чарівності неможливо протистояти.","Іноді ти поводишся як мила дитина.","Ти – моя мрія, що збулася.","Твої губи створені для поцілунків.","Сьогодні ти прекрасна, як і завжди.","Твій погляд зачаровує.","З кожним днем ​​мене тягне до тебе все сильніше.","Твоя фігура приголомшує уяву!","Ти найкрасивіша дівчина з усіх, кого я зустрічав.","Не можу відвести від тебе очей!","Ти особлива і не схожа на інших.","Твоя посмішка сниться мені щоночі.","Ти дуже ніжна.","Думаю про тебе кожну хвилину.","Я готовий на все заради твого щастя.","Ніколи не думав, що зможу так закохатися.","Ти найкраща в світі.","Я ще ніколи не був такий щасливий, як поруч із тобою.","Для мене ти завжди будеш на першому місці.","Я закохався у твій невимушений сміх.","Ти приголомшлива дівчина, і я готовий заради тебе на все.","Я впевнений, що сотні жінок не сплять ночами і тільки й мріють мати хоч тінь твоєї краси!","Якби ти брала участь у конкурсах краси, вони б втратили свою значущість, адже перемога завжди була б твоєю!","Ти ніби зійшла зі сторінок гарної казки!","Ти – витвір мистецтва!","Твої очі – два бездонних океану, в яких я готовий потонути прямо в цю хвилину!","Ти розумна і красива, хіба так може бути це одночасно?","В тобі стільки ніжності, це мене приваблює і робить тебе неймовірно жіночною!","Ти справжня муза, яка дає сили і натхнення для шедеврів!","У тебе найпривабливіша усмішка на світі!","Жодна квітка в світі не зрівняється з твоєю красою.","Ти така витончена і красива, я не можу тобою не захоплюватися!","З роками твоя краса не меркне, а лише знаходить нові фарби!","Твій голос - наче музика, а риси обличчя, як пейзажі красот природи!","Можна зберігати твою фотографію на столику біля ліжка, щоб милуватися прекрасними рисами цілодобово?","Як майстерно ти підбираєш гардероб, ти виглядаєш чудово!","Посміхайся частіше, адже небо хмуриться тільки від того, що не бачить твою посмішку!","Де ж твій німб? Ти ангел, не інакше! Звичайні жінки не бувають такими красивими!","Будь ласка, скажи мені, що я зможу милуватися твоєю красою вічно!","В тобі немає вад і навіть те, що ти вважаєш недоліками – гідності в очах інших людей!"]);t.addEventListener("click",(function(e){"card__link"!==e.target.className&&(t.classList.toggle("is-flipped"),t.classList.contains("is-flipped")&&(n.textContent=o()))})),window.FLS=!0,function(e){let t=new Image;t.onload=t.onerror=function(){e(2==t.height)},t.src="data:image/webp;base64,UklGRjoAAABXRUJQVlA4IC4AAACyAgCdASoCAAIALmk0mk0iIiIiIgBoSygABc6WWgAA/veff/0PP8bA//LwYAAA"}((function(e){let t=!0===e?"webp":"no-webp";document.documentElement.classList.add(t)}))})();